    hight: "20px",
    textAlign: "center"
  },
  button: {
    marginBottom: "1em",
    height: "50px"
  },
  rightIcon: {
    marginLeft: theme.spacing.unit * 2,
  },
  report: {
    marginTop: "30px",
  },
  exportButton: {
    minWidth: "100px",
    margin: "1em"
  },
  clearButton: {
    marging: "1em"
